/**
 * Avoid `console` errors in browsers that lack a console.
 */
(function() {
    var method;
    var noop = function () {};
    var methods = [
        'assert', 'clear', 'count', 'debug', 'dir', 'dirxml', 'error',
        'exception', 'group', 'groupCollapsed', 'groupEnd', 'info', 'log',
        'markTimeline', 'profile', 'profileEnd', 'table', 'time', 'timeEnd',
        'timeStamp', 'trace', 'warn'
    ];
    var length = methods.length;
    var console = (window.console = window.console || {});

    while (length--) {
        method = methods[length];

        // Only stub undefined methods.
        if (!console[method]) {
            console[method] = noop;
        }
    }
}());

/**
 * Submits the content of a form asynchronously (AJAX)
 */
(function($) {

    $.fn.asyncFileUpload = function(userSettings) {

        var defaults = {
            afterSubmit : function(){},
            success : function(data){},
            error: function(err){}
        };
        var settings = $.extend({}, defaults, userSettings);

        return this.each(function(){

            var $form = $(this);
            var formData = new FormData(this);
            var files = $form.find(':file')[0].files;
            var i = 0;

            if (files.length >= 30) {
                settings.error('Cannot upload more than 30 images at a time.');
                return;
            }

            for (; i<files.length; i++) {
                // check size (must be <= 5 MB)
                if (files[i].size / 1024 / 1024 > 5) {
                    settings.error('The size of image "'+files[i].name+'" exceeds 5 MB.');
                    return;
                }

                if (files[i].type !== 'image/jpeg' && files[i].type !== 'image/png') {
                    settings.error('Image "'+files[i].name+'" is not a valid image (jpeg/png).');
                    return;
                }
            }

            // Append the host and protocol (needed for CORS on the server side)
            formData.append('host', window.location.hostname);
            formData.append('protocol', window.location.protocol);

            $.ajax({
                url: $form.attr('action'),
                type: 'POST',
                success: settings.success,
                error: settings.error,
                // Form data
                data: formData,
                dataType: 'json',
                crossDomain: true,
                //Options to tell jQuery not to process data or worry about content-type.
                cache: false,
                contentType: false,
                processData: false
            });

            settings.afterSubmit();

            return this;
        });
    };

})(jQuery);


